// src/pages/GettingStarted.js
import React from 'react';

const GettingStarted = () => {
  const videos = [
    {
      title: 'Smartphone Basics',
      description: 'Learn the basics of using a smartphone, including settings, apps, and essential features.',
      url: 'https://www.youtube.com/watch?v=example1'
    },
    {
      title: 'Computer Basics',
      description: 'Understand the fundamentals of using a computer, including file management and system settings.',
      url: 'https://www.youtube.com/watch?v=example2'
    },
    {
      title: 'Internet Safety for Beginners',
      description: 'An introduction to safe internet practices for new users.',
      url: 'https://www.youtube.com/watch?v=example3'
    }
  ];

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Getting Started Videos</h2>
      <div style={styles.videoList}>
        {videos.map((video, index) => (
          <div key={index} style={styles.videoItem}>
            <h3 style={styles.videoTitle}>{video.title}</h3>
            <p style={styles.videoDescription}>{video.description}</p>
            <a href={video.url} target="_blank" rel="noopener noreferrer" style={styles.videoLink}>
              Watch on YouTube
            </a>
          </div>
        ))}
      </div>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    maxWidth: '800px',
    margin: '0 auto',
    fontFamily: 'Arial, sans-serif'
  },
  heading: {
    fontSize: '24px',
    fontWeight: 'bold',
    marginBottom: '20px',
    textAlign: 'center',
    color: '#333'
  },
  videoList: {
    display: 'flex',
    flexDirection: 'column',
    gap: '15px'
  },
  videoItem: {
    padding: '15px',
    border: '1px solid #ddd',
    borderRadius: '8px',
    backgroundColor: '#f9f9f9'
  },
  videoTitle: {
    fontSize: '18px',
    fontWeight: 'bold',
    color: '#555'
  },
  videoDescription: {
    fontSize: '14px',
    color: '#777',
    marginBottom: '10px'
  },
  videoLink: {
    fontSize: '16px',
    color: '#1e90ff',
    textDecoration: 'none'
  }
};

export default GettingStarted;
